import { FaBars } from "react-icons/fa";
import { NavLink } from "react-router-dom";

function ProductScan() {
  return (
    <section className="grid place-items-center">
      <div className="max-w-[30rem] w-full p-4">
        <div className="flex justify-end">
          <FaBars className="text-xl" />
        </div>
        <div className="flex flex-col justify-center items-center mt-28">
          {/* 
      ///////////Image & Title////////
      ////////////////////////// */}
          <div className="">
            <img
              src="/images/productImage.svg"
              className="rounded-full w-full"
            />
          </div>
          <div className="flex flex-col justify-center items-center ">
            <p className="text-[#3B2B2F] text-6xl text-center">DOJA - C99</p>
          </div>
          {/* 
      ///////////Buttons////////
      ////////////////////////// */}
          <div className="w-full px-5">
            <NavLink
              to={"confirm"}
              type="button"
              className="mt-10 w-full py-4 bg-[#A7AE45] text-[#fff] rounded-xl text-2xl font-bold font-family text-center cursor-pointer]"
            >
              Confirm Product
            </NavLink>

            <NavLink
              to={"/"}
              type="button"
              className="w-full py-4 bg-[#A7AE45] mt-3 text-[#fff] rounded-xl text-2xl font-bold font-family text-center cursor-pointer]"
            >
              <span className="flex items-center justify-center">
                <img src="/images/PZNSny.svg" />
                <span> Scan Again</span>
              </span>
            </NavLink>
          </div>
        </div>
      </div>
    </section>
  );
}

export default ProductScan;
